import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import BottomNav from './components/BottomNav';
import Dashboard from './pages/Dashboard';

// Placeholder components for other pages so the app doesn't crash
const Placeholder = ({ title }) => (
  <div className="p-6 text-white min-h-screen pb-20">
    <h1 className="text-3xl font-bold mb-4">{title}</h1>
    <p className="text-gray-400">This feature is under construction.</p>
  </div>
);

function App() {
  return (
    <Router>
      <div className="bg-background min-h-screen text-white font-sans">
        <Routes>
          {/* Redirect root to dashboard */}
          <Route path="/" element={<Navigate to="/dashboard" />} />

          {/* Main Routes */}
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/workouts" element={<Placeholder title="Workouts" />} />
          <Route path="/ai-coach" element={<Placeholder title="AI Coach" />} />
          <Route path="/nutrition" element={<Placeholder title="Nutrition" />} />
          <Route path="/profile" element={<Placeholder title="Profile" />} />
        </Routes>

        {/* Bottom Navigation (Always Visible on Mobile) */}
        <BottomNav />
      </div>
    </Router>
  );
}

export default App;
